import React from "react";
import styles from "./Icon.module.css";

import Image from "next/image";

export const Icon = ({ img, link, alt }) => {
  return (
    <a href={link}>
      <Image
        src={img}
        alt={alt}
        width={20}
        height={20}
        className={styles.objetiveFitCover}
      />
    </a>
  );
};
